import { ComponentFixture, TestBed } from '@angular/core/testing';
import { CdbComponent } from './cdb.component';
import { HttpClientTestingModule } from '@angular/common/http/testing';
import { By } from '@angular/platform-browser';

describe('CdbComponent', () => {

  let component: CdbComponent;
  let fixture: ComponentFixture<CdbComponent>;

  beforeEach(async () => {
    await TestBed.configureTestingModule({
      declarations: [CdbComponent],
      providers: [CdbComponent],
      imports: [HttpClientTestingModule]
    })
    .compileComponents();

    fixture = TestBed.createComponent(CdbComponent);
    component = fixture.componentInstance;
    fixture.detectChanges();
  });

  it('should create', () => {
    expect(component).toBeTruthy();
  });

  it('verificar se o valor inicial alterou', () => {
    component.valorInicial = 1000;
    fixture.detectChanges();
    const element = fixture.debugElement.query(By.css('#valorinical'));
    expect((element.nativeElement as HTMLInputElement).textContent.toEqual('1000'))
  });

});
